import styled from 'styled-components';

export const LogoContainerStyled = styled.div`
  display: flex;
  position: absolute;
  top: 0;
  left: 0;
  align-items: center;
  justify-content: center;
  height: ${({theme}) => theme.menuHeight};
  width: ${({theme}) => theme.menuHeight};
  z-index:30;

`;
